(1, 'Uno', 'Mattel', , 7.5, 'Le Uno est un jeu de cartes américain créé en 1971 par Merle Robbins et édité par Mattel. Basé sur les règles du 8 américain (qui se joue avec un jeu de cartes standard), le Uno lui applique un jeu de cartes spécifiquement dédié, ainsi que quelques règles supplémentaires.');
INSERT INTO `jeux` (`id`, `nom`, `editeur`, `picture`, `prix`, `description`) VALUES
(2, 'Munchkin', 'Edge Entertainement', , 19.99, 'Munchkin est un jeu de société de Steve Jackson, illustré par John Kovalic, édité en France par Edge Entertainment (marque commerciale d\'Ubik) et distribué par Millenium.\r\n\r\nPour 3 à 8 joueurs (3-6 sur la boîte de jeu de base. La limite peut être augmentée avec les extensions), le jeu peut durer entre une et deux heures selon le nombre de joueurs impliqués dans la partie.\r\n\r\nIl s\'agit d\'un jeu de cartes humoristique parodiant les jeux de rôles, et en particulier le concept de Gros Bill (munchkin en anglais).');
